import React from 'react'
import SMButton from '../config/components/button'

export default function Headerr() {
    return (
        <>
        <div className='headerdiv'>
            <Box>Lorem ipsum dolor sit amet consectetur adipisicing elit. Officiis debitis fugiat reprehenderit laborum rem illum, sit accusamus perferendis ipsa temporibus doloremque eum expedita aut minus similique soluta corrupti vitae ex.</Box>
            <Box><SMButton label="Book Now"/></Box>
        </div>
        </>
    )
}
